    return(
        <div>
            <h1>Bem-vindo ao BigPiggs</h1>
            <p>Comece a gerenciar seus projetos agora mesmo!</p>
            <a href="/">Comece aqui</a>
            
            <img 
                src={Piggy} 
                alt="Mulher encostada em um porco de guardar dinheiro"
                className=""
            />
        </div>
    )
}
